import { TableOfProducts } from "./TableOfProducts";
import { Boxes } from "./Boxes";
import { BarChart } from "../../charts/BarChart";
import { ReusableTable } from "../../general_compo/ReusableTable";
import { headers_productTable, rows_data_productTable } from "../../layouts/local_DB/local_DataBase";

export const MainPage = () => {
  return (
    <div className="main_page ps-2 " id="mainPage">
      <Boxes />
      <div className="row">
        {/* <TableOfProducts /> */}
        <ReusableTable
          nameOfColumn={headers_productTable}
          dataOfRows={rows_data_productTable}
          placeholder_searchBox="قسمتی از عنوان را وارد کنید"
          show_addButton={false}
          go_where="/adding-items"
          operation={false}
        />
        <BarChart />
      </div>
    </div>
  );
};
